import React from 'react';
import './style.css';

function App() {
  return (
    <div className="geral-container">
          <div className="menu">
            <ul>
                <li><a href="#">Home</a></li>
                <li><a href="#">Lojas virtuais</a></li>
                <li><a href="#">Objetivo</a></li>
                <li><a href="#">Ongs</a></li>
                <li><a href="#">Contato</a></li>
            </ul>
          </div>

    </div>
  );
}

export default App;
